import React from 'react';

const Contact = () => {
  return (
    <section id="contact">
      <h2>Contact</h2>
      <p>Email: <a href="mailto:srisaketh111@gmail.com">srisaketh111@gmail.com</a></p>
      <p>Phone: +91 93983 04407</p>
      <p>
        LinkedIn: <a href="https://linkedin.com/in/sri-saketh-35767224a" target="_blank" rel="noopener noreferrer">
          linkedin.com/in/sri-saketh-35767224a
        </a>
      </p>
    </section>
  );
};

export default Contact;
